import React from 'react';

function SuperAdminDashboard() {
  return (
    <div className="superadmin-dashboard">
      <h1>Super Admin Dashboard</h1>
      <p>Welcome, Super Admin! You have access to all administrative features.</p>
      <ul>
        <li><a href="/admin-management">Admin Management</a></li>
        <li><a href="/system-settings">System Settings</a></li>
        <li><a href="/user-reports">User Reports</a></li>
      </ul>
    </div>
  );
}

export default SuperAdminDashboard;
